import React from "react";
import { Box, Card, Grid, Link, Tab, Tabs, Typography } from "@mui/material";
import './modules.scss';
import styled from "@emotion/styled";


const StyledTabs = styled((props) => (
    <Tabs
        {...props}
        TabIndicatorProps={{ children: <span className="MuiTabs-indicatorSpan" /> }}
    />
))({
    minHeight: 'unset',
    marginBottom: '5px',
    '& .MuiTabs-indicator': {
        display: 'flex',
        justifyContent: 'center',
        backgroundColor: 'transparent',
    },
    '& .MuiTabs-indicatorSpan': {
        // maxWidth: 40,
        // width: '100%',
        // backgroundColor: '#635ee7',
    },
});


const StyledTab = styled((props) => (
    <Tab disableRipple {...props} />
))(() => ({
    fontSize: '12px',
    textTransform: 'none',
    color: 'black',
    minHeight: '0px',
    padding: '8px 12px',
    minWidth: 'unset',
    transition: 'color .15s ease-in-out,background-color .15s ease-in-out,border-color .15s ease-in-out',
    '&.Mui-selected': {
        color: '#000',
        backgroundColor: '#efefef',
        borderRadius: '4px'
    },
}));

const Modules = () => {

    function TabPanel(props) {
        const { children, value, index, ...other } = props;

        return (
            <div
                role="tabpanel"
                hidden={value !== index}
                id={`simple-tabpanel-${index}`}
                aria-labelledby={`simple-tab-${index}`}
                {...other}
            >
                {value === index && (
                    <Box sx={{ p: 3 }}>
                        <Typography>{children}</Typography>
                    </Box>
                )}
            </div>
        );
    }

    const [value, setValue] = React.useState(0);

    const handleChange = (event, newValue) => {
        setValue(newValue);
    };

    return (
        <Box className='modules'>
            <Box className='modules-body'>
                <Typography variant="h1">Modules</Typography>
                <Box style={{ width: "100%" }}>
                    <StyledTabs value={value} onChange={handleChange}>
                        <StyledTab label="one" />
                        <StyledTab label="two" />
                        <StyledTab label="three" />
                    </StyledTabs>
                </Box>
                <TabPanel value={value} index={0}>
                    Item One
                </TabPanel>
                <TabPanel value={value} index={1}>
                    Item Two
                </TabPanel>
                <TabPanel value={value} index={2}>
                    Item Three
                </TabPanel>
                <Box>
                    <Grid container spacing={2}>
                        <Grid item margin={'auto'} xl={4} lg={4}>
                            <Link className="modules-link">
                                <Card className="modules-card-1">
                                    <img src="https://gw.alipayobjects.com/zos/rmsportal/QCcDSfdbCIbVSsUZJaQK.svg" alt="" />
                                </Card>
                                <Typography>Design Guide</Typography>
                            </Link>
                        </Grid>
                        <Grid item margin={'auto'} xl={4} lg={4}>
                            <Link className="modules-link">
                                <Card className="modules-card-2">
                                    <img src="https://gw.alipayobjects.com/zos/rmsportal/hMSnSxMzmiGSSIXxFtNf.svg" alt="" />
                                </Card>
                                <Typography>Design Guide</Typography>
                            </Link>
                        </Grid>
                        <Grid item margin={'auto'} xl={4} lg={4}>
                            <Link className="modules-link">
                                <Card className="modules-card-3">
                                    <img src="https://gw.alipayobjects.com/zos/rmsportal/OMEOieDFPYDcWXMpqqzd.svg" alt="" />
                                </Card>
                                <Typography>Design Guide</Typography>
                            </Link>
                        </Grid>
                    </Grid>
                </Box>
            </Box>
        </Box>
    )
}

export default Modules;
